import React, { FunctionComponent } from "react";
import { useSelector } from "react-redux";
import FriendComponent from "../../components/friendComponent/friendComponent";
import "./Messages.css";
interface MessagesProps {}

const Messages: FunctionComponent<MessagesProps> = () => {
  const friends = useSelector((state: any) => state.friends.friends);
  const messages = useSelector((state: any) => state.messages.messages);
  return (
    <div className="chat-container">
      <div className="chat-container__chatList">
        {friends.map((item) => {
          return (
            <div className="chat-container__chatListElement">
              <FriendComponent
                imageUrl={item.ProfilePic}
                name={item.Name}
                status={item.isOnline}
              />
            </div>
          );
        })}
      </div>
      <div className="chat-container__message">
        <div className="chat-container__message-window">
          <div className="chat-container__message-windowText">hello</div>
          <div className="chat-container__message-windowInput"><input placeholder="Enter Message"></input></div>
        </div>
      </div>
    </div>
  );
};

export default Messages;
